Unable to generate an IRI when using mongoDb<p>I'm new to the API Platform framework, and for the project I'm working on we're required to use mongoDb.</p>

<p>I followed the instructions on how to set it up with mongoDb (<a href="https://api-platform.com/docs/core/mongodb/" rel="nofollow noreferrer">see here</a>). But I installed <code>doctrine/mongodb-odm:2.0.x.-dev</code> instead of <code>doctrine/mongodb-odm:^2.0.0@beta</code> so that the <code>bin/console doctrine:mongodb:schema:create</code> command works...</p>

<p>In any case, I created a very simple document based off the provided example:</p>

<pre><code>&lt;?php
// api/src/Document/Test.php

namespace App\Document;

use ApiPlatform\Core\Annotation\ApiResource;
use Doctrine\ODM\MongoDB\Mapping\Annotations as ODM;
use Symfony\Component\Validator\Constraints as Assert;

/**
 * @ApiResource
 *
 * @ODM\Document
 */
class Test
{
    /**
     * @ODM\Id(strategy="INCREMENT", type="integer")
     */
    private $id;

    /**
     * @ODM\Field(type="string")
     * @Assert\NotBlank
     */
    private $name;

    public function getId(): ?int
    {
        return $this-&gt;id;
    }

    public function getName(): ?string
    {
        return $this-&gt;name;
    }

    public function setName(string $name): self
    {
        $this-&gt;name = $name;

        return $this;
    }
}
</code></pre>

<p>However, the response I get is:
<code>"Unable to generate an IRI for the item of type \"App\\Document\\Test\""</code>. But as you can see the ID-getter function is there, which seems the be the "usual" cause of the error.</p>

<p>The full Response Body can be found <a href="https://pastebin.com/Cf6zVQew" rel="nofollow noreferrer">in this pastebin</a>.</p>

<p>What am I missing?</p>

<p>Thanks!</p>

