Divide by zero generates an error on mongodb aggregation<p>I have a dataset like this:</p>

<pre><code>{
    "_id" : ObjectId("5c35f04c4e92b8337885d9a6"),
    "activity" : {
        "a1": 10,
        "a2": 11,
        "a3": 12,
        "a4": 13,
        "a5": 14,
        "b1": 5,
        "b2": 6
    }
}
</code></pre>

<p><strong>NOTE:</strong> This is a dummy entries, actual Entries will be around 50 or 60 out of that 30 are from simple addition (like from a1 to a5) and 20 entries are for ratio (like b1 and b2).
For asking the concept I minimize the dataset</p>

<p>Now from a1 to a5 I have to do addition with some weightage value of multiplication like this:
lets say multiplication value is 0.5</p>

<pre><code>so it will be like this:
(a1*0.5 + a2*0.5 + a3*0.5 + a4*0.5 + a5*0.5)
</code></pre>

<p>and then I have to take the ratio of b1 and b2 and then multiply be some weightage  like this</p>

<pre><code>((b1:b2)*0.5)
</code></pre>

<p>So final calculation will be like this:</p>

<pre><code>(a1*0.5 + a2*0.5 + a3*0.5 + a4*0.5 + a5*0.5 + (b1:b2)*0.5)
</code></pre>

<p>For that I used mongodb aggregation. My code is this: </p>

<pre><code>db.Collection.aggregate([
  { $match: { _id: ObjectId("5c35f04c4e92b8337885d9a6") } },
  { $unwind: "$_id" },
  {
    $project: {
      "activity.score": {
        $add: [
          {
            $multiply: [
              "$activity.a1",
              0.5
            ]
          },
          {
            $multiply: [
              "$activity.a2",
              0.5
            ]
          },
          {
            $multiply: [
              "$activity.a3",
              0.5
            ]
          },
          {
            $multiply: [
              "$activity.a4",
              0.5
            ]
          },
          {
            $multiply: [
              "$activity.a5",
              0.5
            ]
          },
          {
            $multiply: [
              {
                $divide: [
                  "$activity.b1",
                  "$activity.b2"
                ]
              },
              0.5
            ]
          }

        ]
      }
    }
  }
])
  .then(data =&gt; {
    console.log(data);
  })
  .catch(error =&gt; {
    console.log(error);
  });
</code></pre>

<p>By this I got the answer, but in case my b2 will be 0 like this:</p>

<pre><code>{
    "_id" : ObjectId("5c35f04c4e92b8337885d9a6"),
    "activity" : {
        "a1": 10,
        "a2": 11,
        "a3": 12,
        "a4": 13,
        "a5": 14,
        "b1": 5,
        "b2": 0
    }
}
</code></pre>

<p>MongoDB generates an error i.e <strong>MongoError: can't $divide by zero</strong>.
Is there anyone who can suggest me How to achieve this. Any help or suggestion is really appreciable for that. Thanks in advance for the effort and interaction.</p>

