Mongo `pre` hook not firing as expected on `save()` operation<p>I am using <code>pre</code> and <code>post</code> hooks in my MongoDB/Node backend in order to compare a pre-save and post-save version of a document so I can generate notes via model triggers based on what's changed. In one of my models/collections this is working, but in another, it's not working as expected, and I'm not sure why. </p>

<p>In the problem case, some research has determined that even though I am calling a <code>pre</code> hook trigger on an operation that uses a <code>save()</code>, when I console out the doc state passed in that <code>pre</code> hook, it's already had the change applied. In other words, the hook is not firing before the <code>save()</code> operation, but after, from what I can tell.</p>

<p>Here is my relevant model code:</p>

<pre><code>let Schema = mongoose
  .Schema(CustomerSchema, {
    timestamps: true
  })
  .pre("save", function(next) {
    const doc = this;
    console.log("doc in .pre: ", doc); // this should be the pre-save version of the doc, but it is the post-save version
    console.log("doc.history.length in model doc: ", doc.history.length);
    trigger.preSave(doc);
    next();
  })
  .post("save", function(doc) {
    trigger.postSave(doc);
  })
  .post("update", function(doc) {
    trigger.postSave(doc);
  });

module.exports = mongoose.model("Customer", Schema);
</code></pre>

<p>The relevant part of the <code>save()</code> operation that I'm doing looks like this (all I'm doing is pushing a new element to an array on the doc called "history"):</p>

<pre><code>exports.updateHistory = async function(req, res) {
  let request = new CentralReqController(
    req,
    res,
    {
      // Allowed Parameters
      id: {
        type: String
      },
      stageId: {
        type: String
      },
      startedBy: {
        type: String
      }
    },
    [
      // Required Parameters
      "id",
      "stageId",
      "startedBy"
    ]
  );

  let newHistoryObj = {
    stageId: request.parameters.stageId,
    startDate: new Date(),
    startedBy: request.parameters.startedBy,
    completed: false
  };

  let customerToUpdate = await Customer.findOne({
    _id: request.parameters.id
  }).exec();

  let historyArray = await customerToUpdate.history;

  console.log("historyArray.length before push in update func: ", historyArray.length);

  historyArray.push(newHistoryObj);

  await customerToUpdate.save((err, doc) =&gt; {
    if (doc) console.log("history update saved...");
    if (err) return request.sendError("Customer history update failed.", err);
  });
};
</code></pre>

<p>So, my question is, if a <code>pre</code> hook on a <code>save()</code> operation is supposed to fire BEFORE the <code>save()</code> happens, why does the document I look at via my console.log show a document that's already had the <code>save()</code> operation done on it?</p>

